async function start(crawlOutput, experienceId) {
  let homePageUrl = crawlOutput[0][0].source.url;
  let broadcasterApiRes = await BroadCasterAPI(homePageUrl);
  let homeIndex = urlsArr.length;
  urlsArr.push(homePageUrl);
  let urlDataObject = JSON.parse(JSON.stringify(urlsDataObject));
  urlDataObject.url = homePageUrl;
  urlsData.push(urlDataObject);
  console.log("Started for url:", homePageUrl, crawlOutput[0][0].source.name);
  let homePageHtml = crawlOutput[0][0].source.dom;
  const [parsedCss, cssContent] = await parseAllCss(homePageUrl, homePageHtml);
  //   console.log(parsedCss);
  console.log("Obtained Home Page HTML Content");
  homePageHtml = await cleanupHTMLContent(homePageHtml);
  console.log("Cleaned Home Page HTML Content");
  // console.log(homePageHtml);
  let homePageHtmlWithIds = await updateIdAutomatically(homePageHtml);
  console.log("Generated Ids for all elements in Home Page HTML");
  // console.log(homePageHtmlWithIds)
  let parsedHomePageHtml = await parseHTML(homePageHtmlWithIds);
  console.log("Parsed Home Page HTML String to Grapesjs Format");
  let baAppCreationPayload = JSON.parse(JSON.stringify(xpbFrameworkPayload));
  baAppCreationPayload.config.pages[0].frames[0].component = {
    ...baAppCreationPayload.config.pages[0].frames[0].component,
    ...parsedHomePageHtml,
  };
  baAppCreationPayload.baAppName = `${url} App`;
  baAppCreationPayload.id = broadcasterApiRes.ba.id;
  baAppCreationPayload.config.styles.push(...parsedCss);
  baAppCreationPayload.css = cssContent;
  urlsData[homeIndex].baId = broadcasterApiRes.ba.id;
  baAppCreationPayload.html.body = homePageHtmlWithIds;
  await createPageNodeInExperience(
    homePageUrl,
    broadcasterApiRes.ba.id,
    experienceId
  );
  for (let pagesArr of crawlOutput) {
    for (let eventsAllData of pagesArr) {
      if (eventsAllData.identification.value === "/HTML[1]") {
        continue;
      }
      if (eventsAllData.target.url === homePageUrl) {
        let elementXpath = eventsAllData.identification.value;
        elementXpath = elementXpath.replace("/HTML[1]/BODY[1]", "");
        elementXpath = elementXpath.toLowerCase();
        let node = await getNodeFromHtmlString(
          homePageHtmlWithIds,
          elementXpath
        );
        if (!node) {
          console.log("Node Not Found");
        }
        let elementId = node[0].attributes[1].nodeValue;
        console.log(elementId);
        let changedHtml = eventsAllData.target.dom;
        changedHtml = await cleanupHTMLContent(changedHtml);
        let result = await htmlDiff(homePageHtml, changedHtml);
        if (result.different) {
          let changes = result.changes;
          for (let i = 0; i < changes.length; i++) {
            if (changes[i].type === "added") {
              const event = JSON.parse(JSON.stringify(event));
              let message = changes[i].message;
              message = await updateIdAutomatically(message);
              message = message.replace(AnsiRegex(), "");
              console.log("message");
              message = message.substring(message.indexOf("<"), message.length);
              event.elementID = elementId;
              event.actions.actionParams.html = message;
              event.actions.actionParams.targetSelector =
                changes[i].before.parentPath;

              baAppCreationPayload.events.push(event);
            }
            else {
              continue;
            }
          }
        } else {
          continue;
        }
      }
      //   else if (urlsArr.includes(eventsAllData.target.url) && !unvisitedUrls.includes(eventsAllData.target.url)) {

      //   }
      else {
        let elementXpath = eventsAllData.identification.value;
        elementXpath = elementXpath.replace("/HTML[1]/BODY[1]", "");
        elementXpath = elementXpath.toLowerCase();
        let node = await getNodeFromHtmlString(
          homePageHtmlWithIds,
          elementXpath
        );
        if (!node) {
          console.log("Node Not Found");
        }
        let elementId = node[0].attributes[1].nodeValue;
        let externalPageLink = {
          source: eventsAllData.source.url,
          elementId: elementId,
          target: eventsAllData.target.url,
        };
        externalEvents.push(externalPageLink);
        console.log("External Page Link:", externalPageLink);
      }
    }
  }
  let res = await xpbFrameworkAPI(baAppCreationPayload);
  await createExperiencePageNode(homePageUrl, experienceId, externalEvents);
}

